import React, { Component } from 'react'
import data from '../SampleData'
export default class Home extends Component {
    state = {
        name: '',
        image: '',
        SampleData: data

    }
    render() {
        return (
            <div>
                <h1>Tv Maze React</h1>
            </div>
        )
    }
}
